import React, { useState, useEffect } from 'react';

const API_BASE_URL = 'http://localhost:8000';

function CodeGeneration({ sessionId }) {
  const [expectation, setExpectation] = useState({
    id: 'user_management_system',
    title: '用户管理系统',
    description: '一个完整的用户管理系统，提供用户账户生命周期管理和安全访问控制',
    status: 'active',
    subExpectations: [
      {
        id: 'user_registration',
        description: '允许新用户注册账户，收集必要信息并创建用户档案'
      },
      {
        id: 'user_authentication',
        description: '验证用户身份，允许合法用户登录系统'
      },
      {
        id: 'profile_management',
        description: '允许用户查看和更新个人资料信息'
      },
      {
        id: 'role_based_access',
        description: '实现基于角色的访问控制'
      }
    ]
  });

  const [generatedCode, setGeneratedCode] = useState(null);
  const [isGenerating, setIsGenerating] = useState(false);
  const [genOptions, setGenOptions] = useState({
    language: 'python',
    framework: 'flask',
    includeTests: true,
    includeDocumentation: true
  });

  const handleGenerateCode = async () => {
    if (!sessionId || !expectation) return;

    setIsGenerating(true);

    try {
      // 实际实现中，这里会调用后端 API
      /*
      const response = await fetch(`${API_BASE_URL}/generate`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Session-ID': sessionId
        },
        body: JSON.stringify({
          expectation_id: expectation.id,
          options: genOptions
        })
      });

      if (response.ok) {
        const data = await response.json();
        setGeneratedCode(data);
      }
      */

      // 模拟生成代码
      setTimeout(() => {
        const mockGeneratedCode = {
          language: 'python',
          files: [
            {
              name: 'app.py',
              content: `from flask import Flask, request, jsonify
from flask_cors import CORS
from flask_jwt_extended import JWTManager, create_access_token, jwt_required, get_jwt_identity
import bcrypt
from models import db, User, Role, UserProfile
import os

app = Flask(__name__)
CORS(app)

# 配置
app.config['SECRET_KEY'] = os.environ.get('SECRET_KEY', 'dev-secret-key')
app.config['SQLALCHEMY_DATABASE_URI'] = os.environ.get('DATABASE_URL', 'sqlite:///users.db')
app.config['SQLALCHEMY_TRACK_MODIFICATIONS'] = False
app.config['JWT_SECRET_KEY'] = os.environ.get('JWT_SECRET_KEY', 'jwt-secret-key')

# 初始化扩展
db.init_app(app)
jwt = JWTManager(app)

@app.before_first_request
def create_tables():
    db.create_all()
    # 创建默认角色
    if not Role.query.first():
        roles = [
            Role(name='admin', description='Administrator'),
            Role(name='user', description='Regular user'),
            Role(name='guest', description='Guest user')
        ]
        db.session.add_all(roles)
        db.session.commit()

@app.route('/api/register', methods=['POST'])
def register():
    data = request.get_json()

    # 验证请求数据
    if not data or not data.get('email') or not data.get('password'):
        return jsonify({'message': 'Missing email or password'}), 400

    # 检查用户是否已存在
    if User.query.filter_by(email=data['email']).first():
        return jsonify({'message': 'User already exists'}), 409

    # 哈希密码
    hashed_password = bcrypt.hashpw(data['password'].encode('utf-8'), bcrypt.gensalt())

    # 创建新用户
    new_user = User(
        email=data['email'],
        password=hashed_password.decode('utf-8'),
        username=data.get('username', data['email'].split('@')[0]),
        role_id=Role.query.filter_by(name='user').first().id
    )

    # 创建用户档案
    profile = UserProfile(
        first_name=data.get('first_name', ''),
        last_name=data.get('last_name', ''),
        phone=data.get('phone', '')
    )

    new_user.profile = profile

    db.session.add(new_user)
    db.session.commit()

    return jsonify({
        'message': 'User registered successfully',
        'user': {
            'id': new_user.id,
            'email': new_user.email,
            'username': new_user.username
        }
    }), 201

@app.route('/api/login', methods=['POST'])
def login():
    data = request.get_json()

    # 验证请求数据
    if not data or not data.get('email') or not data.get('password'):
        return jsonify({'message': 'Missing email or password'}), 400

    # 查找用户
    user = User.query.filter_by(email=data['email']).first()

    # 验证用户和密码
    if not user or not bcrypt.checkpw(data['password'].encode('utf-8'), user.password.encode('utf-8')):
        return jsonify({'message': 'Invalid credentials'}), 401

    # 创建访问令牌
    access_token = create_access_token(identity=user.id)

    # 记录登录活动
    user.record_login()
    db.session.commit()

    return jsonify({
        'message': 'Login successful',
        'access_token': access_token,
        'user': {
            'id': user.id,
            'email': user.email,
            'username': user.username,
            'role': user.role.name
        }
    }), 200

@app.route('/api/profile', methods=['GET'])
@jwt_required()
def get_profile():
    user_id = get_jwt_identity()
    user = User.query.get(user_id)

    if not user:
        return jsonify({'message': 'User not found'}), 404

    return jsonify({
        'user': {
            'id': user.id,
            'email': user.email,
            'username': user.username,
            'role': user.role.name,
            'profile': {
                'first_name': user.profile.first_name,
                'last_name': user.profile.last_name,
                'phone': user.profile.phone,
                'created_at': user.profile.created_at.isoformat()
            }
        }
    }), 200

@app.route('/api/profile', methods=['PUT'])
@jwt_required()
def update_profile():
    user_id = get_jwt_identity()
    user = User.query.get(user_id)

    if not user:
        return jsonify({'message': 'User not found'}), 404

    data = request.get_json()

    # 更新用户名
    if data.get('username'):
        user.username = data['username']

    # 更新档案信息
    if data.get('profile'):
        profile_data = data['profile']
        if profile_data.get('first_name'):
            user.profile.first_name = profile_data['first_name']
        if profile_data.get('last_name'):
            user.profile.last_name = profile_data['last_name']
        if profile_data.get('phone'):
            user.profile.phone = profile_data['phone']

    db.session.commit()

    return jsonify({
        'message': 'Profile updated successfully',
        'user': {
            'id': user.id,
            'email': user.email,
            'username': user.username,
            'profile': {
                'first_name': user.profile.first_name,
                'last_name': user.profile.last_name,
                'phone': user.profile.phone,
                'updated_at': user.profile.updated_at.isoformat()
            }
        }
    }), 200

if __name__ == '__main__':
    app.run(debug=True)
